import { Col, Row, Skeleton } from 'antd';
import React from 'react';

function SkeletonLoading(props) {
	return (
		<Row gutter={[16, 16]}>
			<Col span={12}>
				<Skeleton.Image style={{ width: '100%' }} />
			</Col>

			<Col span={12}>
				<Skeleton active />
			</Col>
		</Row>
	);
}

export default SkeletonLoading;
